<template>
<div class="login-body">
  <div class="login-top">
    厨品秀商户管理中心
  </div>
	<form class="form-horizontal cpx-login" role="form">
	  <div class="form-group">
	    <label for="inputEmail3" class="col-sm-3 control-label">登录账号:</label>
	    <div class="col-sm-9">
	      <input type="text" class="form-control" v-model="formData.phone" value="" id="inputEmail3" placeholder="只支持最高管理员身份">
	    </div>
	  </div>
	  <div class="form-group" v-if="!dynamic">
	    <label for="inputPassword3" class="col-sm-3 control-label">登录密码:</label>
	    <div class="col-sm-9">
	      <input type="password" class="form-control" v-model="formData.password" id="inputPassword3" value="" placeholder="登录密码">
	    </div>
	  </div>
    <div class="form-group" v-else>
      <label for="inputPassword3" class="col-sm-3 control-label">动态密码:</label>
      <div class="col-sm-5">
        <input type="password" class="form-control" v-model="formData.password" id="inputPassword3" value="" placeholder="动态密码">
      </div>
      <button type="button" class="btn btn-success col-sm-4 getCode" :disabled="!isEnabled" @click="getCodeFn">{{getCodeText}}</button>
    </div>
	  <div class="form-group">
	    <div class="col-sm-offset-3 col-sm-3">
	      <button type="button" id="login" class="btn btn-success" @click='login'>登录</button>
	    </div>
      <a href="javascript:;" class="loginType" @click="dynamicFn">{{dynamicText}}</a>
	  </div>
	</form>
  <div class="login-bottom"></div>
</div>
</template>

<script>
export default {

  name: 'login',

  data () {
    return {
    	formData: {
    		phone: '',
    		password: '',
    		pageType: 1
    	},
      dynamic: false,
      dynamicText: '动态密码登录',
      getCodeText: '获取动态密码',
      isEnabled: true,
      time: 60
    };
  },
  created: function(){
    var self = this;
    $(function(){
      $('input[type=password]').on('keyup', function(e){
        e.preventDefault();
        var keycode = e.keyCode;
        if (keycode == 13) {
          self.login();
        };
      })
    })
  },
  methods: {
  	login: function(){
  		var self = this;
      if (this.dynamic) {
        var url = window.domain() + '/phonePasswordLogin';
      } else {
        var url = window.domain() + '/login';
      };
      $('#login').attr('disabled', 'disabled').text('登录中...');
  		$.post(url, this.formData, function(res){
        $('#login').removeAttr('disabled').text('登录');
        if (res.code != 0) {
          parent.Public.tips.init({content: res.msg});
          return;
        };
  			var data = res.data;
        parent.Public.tips.init({type: data.length != 0 ? 3 : 1, content: res.msg});
        if (data.length != 0) {
          $cookie('token', data.token, { expires: 7 });
          $cookie('username', data.realName, { expires: 7 });
          $cookie('userid', data.id, { expires: 7 });
          window.location.href = '/';
        };
  		},'json');
  	},
    dynamicFn: function(){
      this.dynamic = !this.dynamic ? true : false;
      this.dynamicText = this.dynamicText == '密码登录' ? '动态密码登录' : '密码登录';
      this.isEnabled = true;
      this.time = 60;
      this.getCodeText = '获取动态密码';
      clearInterval(this.downT);
    },
    // 获取验证码
    getCodeFn: function(){
      var self = this;
      if (!self.formData.phone || !/1[3,5,7,8][0-9]{9}/.test(self.formData.phone)) {
        parent.Public.tips.init({content: '请输入正确的手机号码'});
        return;
      };
      self.isEnabled = false;
      var params = {
        phone: self.formData.phone
      };
      var url = window.domain() + '/phoneLogin';
      $.post(url, params, function(res){
        self.downT = setInterval(downTime, 1000);
        function downTime(){
          self.time--;
          self.getCodeText = self.time + '秒后重试';
          if (self.time == 0) {
            clearInterval(self.downT);
            self.isEnabled = true;
            self.time = 60;
            self.getCodeText = '获取动态密码';
          };
        }
      },'json');
    }
  }
};
</script>
