  padding-top: 2px;
}
.getCode{
  width: 109px;
  font-size: 13px;
  padding: 7px 12px;
}
.login-top{
  width: 350px;
  margin: 0 auto;
  font-size: 30px;
  color: #fff;
  padding-left: 40px;
  height: 50px;
  line-height: 50px;
  text-align: center;
  margin-bottom: 10px;
  background: url('data:image/png;charset=utf-8;base64,') no-repeat;
  background-position: 10px 0px;
}
.login-bottom{
  width: 100%;
  height: 450px;
  position: absolute;
  bottom: 0;
  left: 0;
  background: url('data:image/png;charset=utf-8;base64,') left no-repeat;
  background-size: 100%;
}
</style>